import React from 'react';
import './stylesFiles/createAccount.css';

const CreateAccount = () => {
    return (
        <div style={{backgroundImage:"linear-gradient(to bottom right,black,darkblue)",paddingtop:"5%"}}>
            <h1 style={{fontSize:"4vw"}}>Create Account</h1>
            <form style={{marginTop:"2%"}} action="#">
                <ul style={{listStyleType:"none", display:"grid"}}>
                    <li style={{gridColumnStart:"1", gridColumnEnd:"2"}}>
                        <input style={{width:"40%"}} placeholder="First name"/>
                    </li>
                    <li style={{gridColumnStart:"2", gridColumnEnd:"3"}}>
                        <input placeholder="Last name"/>
                    </li>
                    <li>
                        <input type="email" placeholder="Address Email"/>
                    </li>
                </ul>
            </form>
        </div>
    );
}

export default CreateAccount;
